import React, { Component, useState, props } from "react";
import { Link } from "react-router-dom";
import style from "./SideNav.module.css";
import Burger from "react-css-burger";
import { FaInstagram, FaLinkedin } from "react-icons/fa";
import { AiOutlineMail } from "react-icons/ai";

export default function SideNav(props) {
  const [hidden, sethidden] = useState(true);
  const [socialHidden, setSocialHidden] = useState(true);

  copyCodeToClipboard = () => {
    const text = "abbyhanlee@gmail.com";
    text.select();
    document.execCommand("copy");
  };
  //   const [active, setActive] = useState(true);

  return (
    <nav className={style.sideNav}>
      <div className={style.arrow} onClick={props.navClick}>
        <Burger burger="arrow" hoverOpacity={0.8} scale={0.75} active="true" />
      </div>

      {/* <img
        className={style.profilePic}
        src="data:image/jpeg;base64,"
      ></img> */}
      <div className={style.name}>Abby Lee</div>
      <ul className={style.navList}>
        <div>
          <li
            className={style.navItem}
            onClick={hidden ? () => sethidden(false) : () => sethidden(true)}
          >
            Art / Design
          </li>
          {hidden ? null : (
            <div className={style.subNav}>
              <Link to="/illustration">
                <li onClick={props.navClick} className={style.subNavItem}>
                  Illustration
                </li>
              </Link>
              <Link to="/graphicDesign">
                <li onClick={props.navClick} className={style.subNavItem}>
                  Graphic Design
                </li>
              </Link>
              <Link to="/other">
                <li onClick={props.navClick} className={style.subNavItem}>
                  Other
                </li>
              </Link>
            </div>
          )}
        </div>
        <Link to="/animation">
          <li onClick={props.navClick} className={style.navItem}>
            Animation
          </li>
        </Link>
        <Link to="/film">
          <li onClick={props.navClick} className={style.navItem}>
            Film
          </li>
        </Link>
        <Link to="/about">
          <li onClick={props.navClick} className={style.navItem}>
            About
          </li>
        </Link>

        <div>
          <li
            className={style.navItem}
            onClick={
              socialHidden
                ? () => setSocialHidden(false)
                : () => setSocialHidden(true)
            }
          >
            Contact
          </li>
          {socialHidden ? null : (
            <div className={style.socialNav}>
              <a
                href="https://www.instagram.com/zestylemonofficial/"
                target="_blank"
              >
                <FaInstagram />
              </a>

              <a onClick={copyCodeToClipboard()}>
                <AiOutlineMail />
              </a>

              <a
                href="https://www.linkedin.com/in/abby-lee-5672b5160/"
                target="_blank"
              >
                <FaLinkedin />
              </a>
            </div>
          )}
        </div>
      </ul>
    </nav>
  );
}
